import React, { useState, useEffect } from 'react';
import { Table, Input, Popconfirm, Form, Typography, message, Button, Card } from 'antd';
import { PlusOutlined } from '@ant-design/icons';
import axios from 'axios';

const { Text } = Typography;

const UserList = () => {
  const [users, setUsers] = useState([]);
  const [editingKey, setEditingKey] = useState('');
  const [form] = Form.useForm();
  const [formData, setFormData] = useState({});
  const [newUserKey, setNewUserKey] = useState(0);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3000/users');
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
      message.error('Error fetching users');
    }
  };

  const isEditing = (record) => record.id === editingKey;

  const edit = (record) => {
    setEditingKey(record.id);
    form.setFieldsValue(record);
    setFormData(record);
  };

  const cancel = () => {
    if (editingKey === 'new') {
      const newData = [...users];
      newData.pop();
      setUsers(newData);
      setNewUserKey(newUserKey - 1);
    }
    setEditingKey('');
    form.setFieldsValue(formData);
  };

  const save = async (id) => {
    try {
      const row = await form.validateFields();
      const newData = [...users];
      const index = newData.findIndex((item) => id === item.id);

      if (index > -1) {
        const item = newData[index];
        newData.splice(index, 1, { ...item, ...row });
        setUsers(newData);
        setEditingKey('');
        await axios.put(`http://localhost:3000/users/${id}`, row);
        message.success('User updated successfully');
      } else {
        const newUser = { ...row, id: newUserKey };
        newData.push(newUser);
        setUsers(newData);
        setEditingKey('');
        setNewUserKey(newUserKey + 1);
        await axios.post('http://localhost:3000/users', newUser); // Crear un nuevo usuario usando POST
        message.success('User added successfully');
      }
    } catch (error) {
      console.error('Error updating user:', error);
      message.error('Error updating user');
    }
  };

  const handleAddUser = () => {
    const newUser = { id: 'new', name: '', email: '', age: '' };
    setUsers([...users, newUser]);
    edit(newUser);
    setNewUserKey(newUserKey + 1);
  };

  const handleSaveUser = async () => {
    try {
      const values = await form.validateFields();
      await axios.post('http://localhost:3000/users', values); // Crear un nuevo usuario usando POST
      message.success('User created successfully');
      fetchData();
      form.resetFields();
    } catch (error) {
      console.error('Error creating user:', error);
      message.error('Error creating user');
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <Form form={form} layout="inline" onFinish={handleSaveUser}>
        <Form.Item name="name" label="Name" rules={[{ required: true, message: 'Please enter name' }]}>
          <Input placeholder="Name" />
        </Form.Item>
        <Form.Item name="email" label="Email" rules={[{ required: true, message: 'Please enter email' }]}>
          <Input placeholder="Email" />
        </Form.Item>
        <Form.Item name="age" label="Age" rules={[{ required: true, message: 'Please enter age' }]}>
          <Input placeholder="Age" />
        </Form.Item>
        <Form.Item>
          <Button type="primary" htmlType="submit">
            Create User
          </Button>
        </Form.Item>
      </Form>
      <Card style={{ marginTop: '20px' }}>
        <Button
          type="primary"
          shape="circle"
          icon={<PlusOutlined />}
          size="large"
          style={{ marginBottom: '20px' }}
          onClick={handleAddUser}
        />
        <Table
          bordered
          dataSource={users}
          columns={columns}
          rowKey="id"
          pagination={{ pageSize: 10 }}
        />
      </Card>
    </div>
  );
};

export default UserList;
